import React, { Component } from 'react'
import { BrowserRouter as Router } from "react-router-dom";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
import "./Home.css";
class Home extends Component {

    constructor(props) {
        super(props);
        this.state = {
          toggleStateA: false
        };
      }
    render() {
        return (
            <div id="main-container">
                <section id="product-overview"></section>
                <section>
                    <h2 className="cards__section-heading">Our Services</h2>
                    <MDBContainer>
                        <MDBRow>
                            <MDBCol md="6">
                                <article className="image-container">
                                    <img src={require("../../assets/card-image.jpg")} width="250" height="250" alt="Halifax"></img>
                                    <h4 className="image-centered">Halifax</h4>
                                </article>  
                            </MDBCol>
                            <MDBCol md="6">.col-md-4</MDBCol>
                        </MDBRow>
                    </MDBContainer>
                </section>
                {/* <div className="jumbotron mt-5">
                    <div className="col-sm-8-mx-auto">
                        <h1 className="text-center">Welcome to Serverless Cloud Plumbing System</h1>
                    </div> */}

            </div>
        )
    }
}

export default Home;
